import React, { Component } from 'react';
import axios from 'axios';

class Table extends Component {
  constructor(props) {
    super(props);
    this.state = {
      cause1: '',
      cause2: '',
      cause3: ''
    };
  }

  componentDidMount() {
    axios.get('http://192.168.1.62:8080/poc-0.0.1-SNAPSHOT/getProp')
      .then(response => {
        console.log(response.data)
        if (response.status === 200 && response != null) {
          this.setState({
            cause1: response.data.cause1,
            cause2: response.data.cause2,
            cause3: response.data.cause3
          });
        } else {
          console.log('problem');
        }
      })
      .catch(error => {
        console.log(error);
      });
  }

  render() {
    return (
      <div>
  <h1>{this.state.cause1}</h1>
  <h1>{this.state.cause2}</h1>
  <h1>{this.state.cause3}</h1>
      </div>
    )
  }
}

export default Table;
